import React, { useState, useEffect } from "react";
import * as customerApi from "../../apis/customer";
import Hoadon from "./Hoadon";

export default function HoadonDagiao(props) {
  const [list, setList] = useState([]);
  useEffect(() => {
    customerApi
      .hoadonDagiao(props.makhachhang)
      .then((success) => {
        if (success.status === 200) {
          setList(success.data.value.$values);
          console.log(success.data.value.$values);
        }
      })
      .catch((error) => {
        console.error(error);
      });
  }, [props.makhachhang]);
  return (
    <div>
      {list.map((value, key) => {
        return (
          <Hoadon
            bill={value}
            key={key}
            makhachhang={props.makhachhang}
          ></Hoadon>
        );
      })}
    </div>
  );
}
